// Decode function
function decodeHTML(encoded)  {
         try  {
                  return decodeURIComponent(escape(atob(encoded)));
         }
         catch (e)  {
                  console.error("Decoding error:", e);
                  return "";
         }
}
// Generate and render HTML
function renderProtectedContent()  {
         const encoded = encodedChunks.join("");
         const html = decodeHTML(encoded);
         document.getElementById("protected-content").innerHTML = html;
}
// Render when DOM is ready
if (document.readyState === "loading")  {
         document.addEventListener("DOMContentLoaded", renderProtectedContent);
}
else  {
         renderProtectedContent();
}
